import "./App.css"
import styled from "styled-components"

function App() {
  return (
    <div className="App">
      <Header></Header>
    </div>
  );
}

export default App;

const Header = styled.header`
  margin: 0;
  margin-bottom: 1rem;
  padding: 0;
  width: 100%;
  height: 1rem;
  background-color: red
`
